import com.netflix.dyno.jedis._
import com.netflix.dyno.connectionpool.Host
import com.netflix.dyno.connectionpool.HostSupplier
import com.netflix.dyno.connectionpool.TokenMapSupplier
import com.netflix.dyno.connectionpool.impl.lb.HostToken
import com.netflix.dyno.connectionpool.exception.DynoException
import com.netflix.dyno.connectionpool.impl.ConnectionPoolConfigurationImpl;
import com.netflix.dyno.connectionpool.impl.ConnectionContextImpl
import com.netflix.dyno.connectionpool.impl.OperationResultImpl
import com.netflix.dyno.connectionpool.impl.utils.ZipUtils

import java.util.Collections
import java.util.Collection
import java.util.Set
import java.util.List

val localhostHost = new Host("demo.pipeline.io", Host.Status.Up)
val localhostToken = new HostToken(100000L, localhostHost)

val localhostHostSupplier = new HostSupplier() {
 @Override
 def getHosts(): Collection[Host] = {
    Collections.singletonList(localhostHost)
 }
}

val localhostTokenMapSupplier = new TokenMapSupplier() {
 @Override
 def getTokens(activeHosts: Set[Host]): List[HostToken] = {
	Collections.singletonList(localhostToken)
 }

 @Override
 def getTokenForHost(host: Host, activeHosts: Set[Host]): HostToken = {
    return localhostToken
 }
}

val redisPort = 6379                        
val dynoClient = new DynoJedisClient.Builder()
             .withApplicationName("pipeline")
             .withDynomiteClusterName("pipeline-dynomite")
             .withHostSupplier(localhostHostSupplier)
             .withCPConfig(new ConnectionPoolConfigurationImpl("localhostTokenMapSupplier")
                .withTokenSupplier(localhostTokenMapSupplier))
             .withPort(redisPort)
             .build()

val recommendations = enrichedRecommendationsDF.collect()

recommendations.foreach(rec => {
  val userId = rec.getInt(0).toString
  dynoClient.del(s"recommendations:${userId}")
})

recommendations.foreach(rec => {
  val userId = rec.getInt(0).toString
  val itemId = rec.getLong(1).toString
  dynoClient.rpush(s"recommendations:${userId}", itemId)
})

val retrievedRecommendations = dynoClient.lrange("recommendations:21619", 0, 9)

val userFactors = userFactorsDF.collect()

userFactors.foreach(factor => {
  val userId = factor.getInt(0).toString
  dynoClient.del(s"user-factors:${userId}")
})

userFactors.foreach(factor => {
  val userId = factor.getInt(0).toString
  val factors = factor.getSeq[Double](1)
  dynoClient.set(s"user-factors:${userId}", factors.mkString(","))
})

val retrievedUserFactors = dynoClient.get("user-factors:21619")

val itemFactors = itemFactorsDF.collect()

itemFactors.foreach(factor => {
  val itemId = factor.getInt(0).toString
  dynoClient.del(s"item-factors:${itemId}")
})

itemFactors.foreach(factor => {
  val itemId = factor.getInt(0).toString
  val factors = factor.getSeq[Double](1)
  dynoClient.set(s"item-factors:${itemId}", factors.mkString(","))
})

val retrievedItemFactors = dynoClient.get("item-factors:10001")
